import React, { Component } from 'react';

class MusicListItem extends Component {
  render () {
    let musicItem = this.props.musicItem;
    return (
      <li className="component-MusicListItem">
        <p>{musicItem}</p>
      </li>
    )
  }
}

export default MusicListItem;
